import React from 'react';

const App = () => {
    return (
        <div className="ui animated button" tabindex="0">
            <div className="visible content">KAREEM</div>
            <div className="hidden content">
                <i className="right arrow icon"></i>
            </div>
        </div> 
    );
};

export default App;
